void FilterController::attach(int analogPin, int p11, int p12, int p13, int p1clk, int p21, int p22, int p23, int p2clk, int p31, int p32, int p33, int p3clk){
    this->analogPin=analogPin;
    LPF.attach(LPKernel);
    BPF.attach(BPKernel);
    HPF.attach(HPKernel);
    LPFBar.attach(p11, p12, p13, p1clk);
    BPFBar.attach(p21, p22, p23, p2clk);
    HPFBar.attach(p31, p32, p33, p3clk);
    pinMode(analogPin, INPUT);
}
void FilterController::run(){
    int index=0;

    for(int i=0; i<KERNEL_SIZE; i++)
        SerialUSB.println(LPKernel[i]);
    while(index!=KERNEL_SIZE)
    {
        float i=ec.pushSample(random(1024));
        LPF.run(i, index);
        BPF.run(i, index);
        HPF.run(i, index);
        index++;
        ec.emitEcho();
    }
    LPFBar.update(LPF.getResult());
    BPFBar.update(BPF.getResult());
    HPFBar.update(HPF.getResult());
}
